//contains all the CSS that handles the layout, such as the container and any grid systems.


.mainContent {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  text-align: center;
  
  section {
    margin: 20%;   
  }
  
  .introSection {
      display: flex;
      flex-direction: column;
      justify-content: flex-start;
      align-items: flex-start;
      text-align: left;
  
      &__title {
        font-size: 50px;
      }
  
      &__image {
        display: none;
    }  
  }
}
  
  .aboutMeSection {
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
  
    &__title--desktop {
      display: none;
      margin-bottom: 0%;
    }
  
    &__aboutMeText {
      font-size: 14px;
      text-align: left;
    }
  
    &__image--mobile {
      width: 65vw;
      max-width: 550px;
      margin-bottom: 5%;
      
    }
  
    &__image--desktop {
      display: none;
    }
  }
  
  .skillsSection {
    display: flex;
    flex-direction: column;
    align-items: center;
    flex-wrap: wrap;
    justify-content: center;
  
    h1, p{
      margin-bottom: 5%;
    }
  

  
    &__icons {
      width: 70%;
      max-width: 600px;
      display: flex;
      flex-wrap: wrap;
      align-items: center;
      justify-content: center;
  
      img {
        height: 20%;
        width: 20%;
        margin: 5%;
      }
    }
  }
  
  .projectsSection {
    display: flex;
    flex-direction: column;
    align-items: center;
  
    h1 {
      font-size: 40px;
      margin-bottom: 5%;
    }
  
    p,
    h1 {
      text-align: left;
      
    }
  
    
  
    
  
    #project5,
    #project6 {
      display: none;
    }
  
    &__contentContainer {
      display: flex;
      flex-direction: column;
  
      div {
        margin-bottom: 5%;
  
        h1 {
          font-size: 30px;
        }
        .buttons {
          margin-top: 3%;
      
        }
  
        img {
          width: 100%;
          //max-width to stop overflow.
          max-width: 60vw;
          height: 25vh;
        }
      }
    }
  }
  
  footer {
    height: 200px;
    background-color: $color-darker-blue;
    color: white;
    display: flex;
    flex-direction: column;
    justify-content: space-around;
    align-items: center;
    background-color: $color-darker-blue;
  
    
  }

